import React from 'react';
import '../../assets/fonts/font.css';
import {
    Navbar,
    Container,
    Nav
 } from 'react-bootstrap';
 import './NavBar.css';
 import DialexaBVG from '../../assets/DialexaBVGMainLogo.png';
 import {
     BrowserRouter as Router,
     Link
 } from "react-router-dom";
 import Login from '../views/Login/Login.js';

class NavBar extends React.Component {
    render() {
        return (
            <Router>
            <Navbar className="nav" expand="lg" fixed="top">
                <Container className="cont">
                    <Navbar.Brand className="brand">
                        <img className="logo" alt="DialexaBVG" src={DialexaBVG}></img>
                    </Navbar.Brand>
                    <Nav class="row justify-content-center align-self-center">
                        <Link to="" className="link">Play</Link>
                        <Nav.Link className="link">Leaderboard</Nav.Link>
                        <Nav.Link className="link">Explore</Nav.Link>
                        <Nav.Link className="link">About</Nav.Link>
                    </Nav>
                    <Navbar.Text className="name">
                        Welcome back, John!
                    </Navbar.Text>
                </Container>
            </Navbar>
            </Router>
        );
    }
}

export default NavBar;
